runtime: java8
inbound_services:
- warmup
derived_file_type:
- java_precompiled
threadsafe: True
auto_id_policy: default
beta_settings:
  'source_reference': 'https://github.com/Downey03/EmployeeProjectGradleBuild.git#71af217017ecf047af3b005ee885be3c65022871'
api_version: 'user_defined'
handlers:
- url: (/.*)
  static_files: __static__\1
  upload: __NOT_USED__
  require_matching_file: True
  login: optional
  secure: optional
- url: /
  script: unused
  login: optional
  secure: optional
- url: /.*/
  script: unused
  login: optional
  secure: optional
- url: /_ah/.*
  script: unused
  login: optional
  secure: optional
- url: .*\.jsp
  script: unused
  login: optional
  secure: optional
- url: /RemoveAccountController
  script: unused
  login: optional
  secure: optional
- url: /LogoutController
  script: unused
  login: optional
  secure: optional
- url: /LoginController
  script: unused
  login: optional
  secure: optional
- url: /SignUpController
  script: unused
  login: optional
  secure: optional

skip_files: app.yaml
